;; **
;;; The Lagrangian for a double pendulum:
;; **

;; @@
(def L [:plus [:times 0.5 [:plus m1 m2] [:times [:times l1 'omega1] [:times l1 'omega1]]] [:times 0.5 m2 [:times [:times l2 'omega2] [:times l2 'omega2]]] [:times m2 l1 l2 'omega1 'omega2 [:cos [:minus 'theta1 'theta2]]] [:times [:plus m1 m2] g l2 [:cos 'theta2]]]
  
  )
